import React, { Component } from 'react';
export class About extends Component {
    render() {
        return <div className="container">
            <p>
            I am an international student from China. This is my third year in Seattle and I just got my Washington State driver's liscense. 
            And then I became really into cars. I love looking at different kinds of cars and hope one day I can buy one of them listed in 
            my interests page.</p>
            <img src="img/car.jpg" alt="carinseattle"/>
        </div>
    }
}
